import React, { lazy, Suspense } from 'react';

const PokemonList = lazy(() => import('./components/PokemonList'));

function App() {
  return (
    <div className="App">
      <Suspense fallback={<div>Loading...</div>}>
        <PokemonList />
      </Suspense>
    </div>
  );
}

export default App;
